import React, { useState } from 'react';
import { Table, Col, Row, Button, Form } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function ScheduleTeacher({ show, handleClose, darkMode, schedule_stud_prof, data }) {
  const [editedStages, setEditedStages] = useState(schedule_stud_prof.map(stage => ({
    ...stage,
    completion_mark: stage.completion_mark || '',
    absence: stage.absence || ''
  })));

  const handleClick = async () => {
    await generateTask({
      data: data.user[0],
      request_data_task: data.request_without_student[0],
      schedule_stud_prof: editedStages,
      teacher_ei: data.teacher_employee_information[0]
    });
  };

  const handleInputChange = (index, field, value) => {
    const updatedStages = [...editedStages];
    updatedStages[index][field] = value === 'true';
    setEditedStages(updatedStages);
  };

  return (
    <div className='container_modal'>
      <div className='p-2'>
        <Table bordered hover>
          <thead>
            <tr>
              <th>Этап</th>
              <th>Срок выполнения этапа</th>
              <th>Результат</th>
              <th>Отметка о выполнении этапа</th>
              <th>Неявка</th>
            </tr>
          </thead>
          <tbody>
            {editedStages.map((stage, index) => (
              <tr key={stage.id}>
                <td>{stage.stage_name}</td>
                <td>{stage.start} - {stage.end}</td>
                <td>{stage.result}</td>
                <td>
                  {data.user.type_of_user === 'Руководитель' ? (
                    <Form.Control
                      as="select"
                      value={stage.completion_mark}
                      onChange={(e) => handleInputChange(index, 'completion_mark', e.target.value)}
                    >
                      <option value='true'>Выполнено</option>
                      <option value='false'>Не выполнено</option>
                    </Form.Control>
                  ) : (
                    stage.completion_mark.toString()
                  )}
                </td>
                <td>
                  {data.user.type_of_user === 'Руководитель' ? (
                    <Form.Control
                      as="select"
                      value={stage.absence}
                      onChange={(e) => handleInputChange(index, 'absence', e.target.value)}
                    >
                      <option value='true'>Да</option>
                      <option value='false'>Нет</option>
                    </Form.Control>
                  ) : (
                    stage.absence.toString()
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>
      <Row className="justify-content-between px-3">
        <Col md={5}>
          <Button variant='none' className='button_cancel' onClick={handleClick}>Экспортировать</Button>
        </Col>
        <Col md={5}>
          {data.user.type_of_user === 'Руководитель' ? (
            <Link to='/create_schedule_work_fqw'>
              <Button variant='none' className='button_next' onClick={handleClose}>Редактировать</Button>
            </Link>
          ) : (
            <Button variant='none' className='button_next' onClick={handleClose}>Ок</Button>
          )}
        </Col>
      </Row>
    </div>
  );
}

export default ScheduleTeacher;
